graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Multi-Module Application</b></font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "Start" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Start</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Application Start</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "Merge" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Merge</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Merge Results</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "End" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>End</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Application End</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "InitA" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>InitA</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "ProcessA" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ProcessA</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "CompleteA" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>CompleteA</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "InitB" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>InitB</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "ProcessB" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ProcessB</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "CompleteB" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>CompleteB</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "InitC" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>InitC</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "ProcessC" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ProcessC</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "CompleteC" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>CompleteC</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];

  // Edges
  "Start" -> "InitA" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "InitA" -> "ProcessA" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "ProcessA" -> "CompleteA" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "CompleteA" -> "Merge" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "Start" -> "InitB" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "InitB" -> "ProcessB" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "ProcessB" -> "CompleteB" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "CompleteB" -> "Merge" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "Start" -> "InitC" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "InitC" -> "ProcessC" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "ProcessC" -> "CompleteC" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "CompleteC" -> "Merge" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "Merge" -> "End" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
}
